import logo from './logo.svg';
import './App.css';
//import { Anagram } from './anagram.js';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Enter word to generate anagrams
        </p>
        <input id='search' placeholder='enter word'></input>
        <input type='submit' value='Generate' onClick={search}></input>
        <p id='anagrams'></p>
      </header>
    </div>
  );
}

function search() {
  //var wordToSearchFor = document.getElementById('search').value;

  // get request to port 3000
  // disable CORS
  fetch('http://localhost:3000', {
     mode: 'no-cors',
     method: 'GET',
     headers: {
       'Content-Type': 'application/json'
     }, 
    })
  .then(function (response) {
    document.getElementById('anagrams').innerHTML = response.text();
    console.log(response.text());
  })
  .catch(function (err) {
    console.log('Fetch Error :-S', err);
  });
}

export default App;
